import avatarka from '../image/down2.jpg';

let state = {
  myPage: {
    person: [
      { name: 'Sasha', id: '1' },
      { name: 'Tyom', id: '2' },
      { name: 'Viktoria', id: '3' },
      { name: 'Ann', id: '4' },
      { name: 'Ani', id: '5' },
    ],
    messagePage: {
      messages: [
        { msg: 'Hi' },
        { msg: 'How is your komasutra?' },
        { msg: 'Yo' },
      ],
    },
  },

  mymsg: [
    { img: avatarka, ike: 'like', msg: 'barior axperner' },
    { img: avatarka, ike: 'like', msg: 'inchka chka' },
  ],
};
export default state;
